import Button  from 'bootstrap'
import React, { Component } from 'react'

export default class My extends Component {
    constructor(props){
        super()
        this.state = {
            count : 0
        }
    }
  render() {
    const {count} = this.state
    return (
      <div>
           <h1>Count: {count}</h1>
           <Button>+</Button>
      </div>
    )
  }
}
